import Button from "../comm/Button";

const CalCalrorie2 = () => {
       return (
        
        <div className="flex py-20 space-x-20 justify-center ">
            <div className="border-orange-100"></div>
            <Button className="border-orange-100" caption="일별칼로리"/>
            <Button className="border-pink-100" caption="주별칼로리"/>
            <Button className="border-blue-100" caption="월별칼로리"/>
        </div>
    ); 
}

export default CalCalrorie2
